import React from 'react';
import { Link } from 'react-router-dom';

const DashboardPage = () => {
  const studentName = localStorage.getItem('name');
  const rollNumber = localStorage.getItem('rollNumber');

  return (
    <div style={containerStyle}>
      <div style={headerStyle}>
        <h1 style={headerTextStyle}>Student Dashboard</h1>
        <p style={subHeaderTextStyle}>
        ðŸ‘‹ Welcome, <strong>{studentName}</strong> <br />
         Access your academic and campus resources here.
        </p>

      </div>
      
      <div style={gridStyle}>
        <Link to="/timetable" style={cardStyle}>
          <h3 style={cardTitleStyle}>Timetable</h3>
          <p style={cardDescriptionStyle}>View your class schedule.</p>
        </Link>

        <Link to="/exam-schedule" style={cardStyle}>
          <h3 style={cardTitleStyle}>Exam Schedule</h3>
          <p style={cardDescriptionStyle}>View your upcoming exams.</p>
        </Link>

        <Link to="/assignments" style={cardStyle}>
          <h3 style={cardTitleStyle}>Assignments</h3>
          <p style={cardDescriptionStyle}>Check your ongoing and upcoming assignments.</p>
        </Link>

        <Link to="/marks" style={cardStyle}>
          <h3 style={cardTitleStyle}>Marks</h3>
          <p style={cardDescriptionStyle}>Check your latest marks and performance.</p>
        </Link>

        <Link to="/attendance" style={cardStyle}>
          <h3 style={cardTitleStyle}>Attendance</h3>
          <p style={cardDescriptionStyle}>Track your attendance records.</p>
        </Link>

        <Link to="/events" style={cardStyle}>
          <h3 style={cardTitleStyle}>Events</h3>
          <p style={cardDescriptionStyle}>Stay updated on upcoming campus events.</p>
        </Link>

        <Link to="/placements" style={cardStyle}>
          <h3 style={cardTitleStyle}>Placements</h3>
          <p style={cardDescriptionStyle}>Check placement opportunities and updates.</p>
        </Link>

        <Link to="/fees" style={cardStyle}>
          <h3 style={cardTitleStyle}>Fees</h3>
          <p style={cardDescriptionStyle}>View and manage your fee payments.</p>
        </Link>
      </div>
    </div>
  );
};

// Styling for the dashboard page
const containerStyle = {
  padding: '20px',
  fontFamily: 'Arial, sans-serif',
  background: 'linear-gradient(135deg, #F0F2F5, #D1E0E0)',
  minHeight: '100vh',
};

const headerStyle = {
  textAlign: 'center',
  marginBottom: '30px',
};

const headerTextStyle = {
  fontSize: '3rem',
  color: '#2A3D4D',
};

const subHeaderTextStyle = {
  fontSize: '1.2rem',
  color: '#3A4F61',
};

const gridStyle = {
  display: 'grid',
  gridTemplateColumns: 'repeat(auto-fill, minmax(250px, 1fr))',
  gap: '20px',
  paddingTop: '20px',
};

const cardStyle = {
  backgroundColor: '#FFFFFF',
  borderRadius: '10px',
  boxShadow: '0px 4px 10px rgba(0, 0, 0, 0.1)',
  padding: '20px',
  textDecoration: 'none',
  color: 'inherit',
  transition: '0.3s',
  textAlign: 'center',
  cursor: 'pointer',
};

const cardTitleStyle = {
  fontSize: '1.5rem',
  fontWeight: 'bold',
  color: '#2A3D4D',
  marginBottom: '10px',
};

const cardDescriptionStyle = {
  fontSize: '1rem',
  color: '#A0B2B8',
};

export default DashboardPage;
